import React, {Component} from 'react';
import news from './news-data';
import "slick-carousel/slick/slick.scss";
import "slick-carousel/slick/slick-theme.scss";
import Slider from "react-slick";
import { Container } from 'reactstrap';
import styles from './Test.module.scss';
import Title from '../UI/Title/Title';

export default class Test extends Component {
  constructor(props) {
    super(props);
    this.state = {
      properties: news.properties,
      property: news.properties[0]
    }
  }


  render() {

    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 2,
      slidesToScroll: 2
    };

    const {property, properties} = this.state;

    return(
      <Container>
        <Slider {...settings}>
          {/* <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div> */}
          <div className={styles.news__wrapper}>
            {properties.map((item) => (
                  <div key={item.id} className={styles.news__item}>
                    <Title>
                      <h3 className={styles.news__title}>{item.title}</h3>
                    </Title>
                    <p className={styles.news__text}>{item.text}</p>
                    <span className={styles.news__date}>{item.date}</span>
                  </div>
            ))}
          </div>

        </Slider>
      </Container>
    )
  }
}
